    DECLARE @filePath VARCHAR(255);
    DECLARE @fileName VARCHAR(255);
    DECLARE @bcpCommand VARCHAR(8000);
    DECLARE @dataToExport varbinary(max); -- Assuming your binary data is in a VARBINARY(MAX) column

    -- Example: Retrieve a specific binary data and define file path/name
